import React from "react";
import "./App.css";
import TodoWrapper from "./Components/TodoWrapper";

function App() {
  return (
    <div className="App">
      <br />
      <br />
      <h2>Add Task and be Punctual</h2>
      <h3>Todo App</h3>
      <TodoWrapper />
    </div>
  );
}

export default App;
